import React from 'react';
import logo from '../logo.svg';
import './App.css';
import Navbar from '../components/navbar.js';
import MainBody from '../components/mainbody.js';
import Footer from '../components/footer.js';
import "bootstrap/dist/css/bootstrap.min.css";
import "shards-ui/dist/css/shards.min.css";
import "shards-ui/dist/css/shards-extras.min.css";

export default class IndexPage extends React.Component {
render() {
<html>
  <head>
    <meta charset="utf-8"></meta>
    <meta http-equiv="x-ua-compatible" content="ie=edge"></meta>
    <title>CAC- Crypto Asset Consortium</title>
    <meta name="description" content="A demo landing page for agencies or product oriented businesses built using Shards, a free, modern and lightweight UI toolkit based on Bootstrap 4."></meta>
    <meta name="viewport" content="width=device-width, initial-scale=1"></meta>

    <link rel="manifest" href="%PUBLIC_URL%/manifest.json"></link>

    <link href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossorigin="anonymous"></link>
    <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css"></link>
    <link rel="stylesheet" href="css/shards.min.css?v=3.0.0"></link>
    <link rel="stylesheet" href="css/shards-extras.min.css?version=3.0.0"></link>

    <title>React App</title>
  </head>
  <body className="shards-landing-page--1">
    <noscript>You need to enable JavaScript to run this app.</noscript>
    <div>
            <Navbar></Navbar>
                <MainBody></MainBody>
            <Footer></Footer>   
        </div>

  </body>
  <script src="https://kit.fontawesome.com/bd21ab8235.js" crossorigin="anonymous"></script>
</html>

 

  }
}
